import './App.css';
import { Header } from './webheader/head.js';
import { Tab,Tabs} from './components/Tabs.js';
function App() {
  return (
      <div className='h-[100vh] justify-center'>
          <Header />
          <Tabs>
        <Tab label="MyIECEP">
        <div class="flex flex-col justify-center">
          <div>
            <p>IOS-MyIECP</p>
            <p>Donwload</p>
            </div>
          <div>AndroidMyIECP</div>

        </div>


        </Tab>
        <Tab label="HIMS">
          <div className="py-4">
            <div>
            <a href="url">link text</a>
            </div>

          </div>
        </Tab>

      </Tabs>

      </div>
  );
}

export default App;

